export class OrderItem {
  id: number = 0;
  orderId: number = 0;
  customerId: number = 0;
  customerName: string = '';
  productId: number = 0;
  productName: string = '';
  productDescription: string = '';
  productCategoryName: string = '';
  productImageFile: string = '';
  productUnitOfMeasure: string = '';
  quantity: number = 0;
  price: number = 0;
}
